import React from 'react';
import './scan.css';
import logo from '../../assets/mirror.png';
// import Webcam from 'react-webcam';
// import WebcamCapture from './webcam.js';

export const Scan = () => {
  return (
    <div class="card">
        <img src={logo} alt='logo' />
    </div>
  )
}

export default Scan
